import './App.css';

export const Navbar = () => {
    return(
        <nav>
            <div>
                <div></div>
                <p>Jossue Fuentes</p>
            </div>
            <div>
                <ul>
                    <li>Home</li>
                    <li>Articles</li>
                    <li>Portfolio</li>
                    <li>Stack</li>
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
